I had the pleasure of organizing a retreat in Sedona with a group of girls and it was truly a wonderful experience. Over the course of 2.5 days, so much happened that left us all overflowing with emotions. The retreat was both fun and adventurous, but also deep and meaningful.

I am grateful for everyone who was a part of it, and especially Natalie and Valeria for leading us in our practices. Their guidance and expertise made a significant impact on our experience. 

Overall, I feel like this retreat was the right thing for me to do. It allowed me to connect with others, explore new experiences, and grow in meaningful ways. I am thankful for this opportunity and will always cherish the memories from our time in Sedona.

